(use '(loom graph io attr))
(use 'loom-gorilla.render)
(use '(gorilla-repl table latex))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(defn r-node [] (keyword (str (rand-int 4))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/r-node</span>","value":"#'user/r-node"}
;; <=

;; @@
(defn r-edge [] [(r-node) (r-node) (rand-int 10)])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/r-edge</span>","value":"#'user/r-edge"}
;; <=

;; @@
(defn r-wdg [] (apply weighted-digraph (repeatedly 5 r-edge)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/r-wdg</span>","value":"#'user/r-wdg"}
;; <=

;; @@
(def g (r-wdg))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/g</span>","value":"#'user/g"}
;; <=

;; @@
(def g (-> g
        (add-attr :1 :shape "square")
        (add-attr :1 :color "red")
        (add-attr :1 :style "filled")
        (add-attr :1 :fillcolor "blue")))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;user/g</span>","value":"#'user/g"}
;; <=

;; @@
(loom-view g :alg :neato)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/PNG;base64,\"/>","value":"#loom_gorilla.render.LoomView{:content #loom.graph.BasicEditableWeightedDigraph{:nodeset #{:0 :1 :2 :3}, :adj {:2 {:3 9, :1 2}, :1 {:1 0}, :0 {:1 7}}, :in {:3 #{:2}, :1 #{:0 :1 :2}}, :attrs {:1 {:shape \"square\", :color \"red\", :style \"filled\", :fillcolor \"blue\"}, :2 {:style \"filled\"}}}, :opts (:alg :neato)}"}
;; <=

;; @@
(table-view (repeatedly 3 (fn [] (repeatedly 2 #(loom-view (r-wdg) :alg :neato)))) 
            :columns [:foo (latex-view "\\sum_{n=0}^{foo} bar^n")])
;; @@
